webpackJsonp([0x69e2b30425a2],{4839:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"The New Boss",date:"05 Feb 2000",slug:"/2000-02-05-the-new-boss/",tags:"Y2000"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/02/crh0205.jpg" height="263" width="350" border="0" alt="crh0205.jpg: " /></p>\n<p><a href="http://Mama.editthispage.com/2000/02/05">Mama</a> is going grouse hunting! The "Moorhuhnjagd" is a free game that is taking over PCs in Germany. It lasts just 90 seconds, and there are only 3 commands: space to start, left click to shoot anything that moves, and right click to reload. It\'s in German, but simple for anyone to figure out. http://www.johnniewalker.de/moorhuhn/jwjagd.exe (1.9 MB)</p>'},next:{fields:{title:"Casual Friday",date:"04 Feb 2000",slug:"/2000-02-04-casual-friday/"}},previous:{fields:{title:"Watching the World Go Round",date:"06 Feb 2000",slug:"/2000-02-06-watching-the-world-go-round/"}}},{node:{fields:{title:"Casual Friday",date:"04 Feb 2000",slug:"/2000-02-04-casual-friday/",tags:"Y2000"},html:'<p>Jim Roepcke: <a href="http://jim.roepcke.com/2000/02/02">Casual Friday for the telecommuter</a> (via <a href="http://carpediem.editthispage.com/">carpediem</a>)</p>\n<p><a href="http://dailynews.yahoo.com/h/ap/20000204/bs/europe_telecom_takeover_22.html">Mannesmann, Vodafone Set To Merge</a> </p>\n<p>New York Times: <a href="http://www.nytimes.com/yr/mo/day/late/04austria.html">Haider\'s Party Sworn Into New Austrian Government</a> "(T)he icy manner and averted gaze of President Thomas Klestil conveyed all his personal distaste for the intermittently hate-mongering politics of Mr. Haider\'s rightist party" </p>\n<p>Christopher passed his "U3", the third of a series of 10 required medical examinations for all pre-school children in Germany (the first two were at the hospital). Mama was very happy with the "Kinderarzt" (pediatrician).</p>\n<p>Christopher has been cranky the past couple of nights, though. Maybe the honeymoon is over?</p>'},next:{fields:{title:"Thursday",date:"03 Feb 2000",slug:"/2000-02-03-thursday/"}},previous:{fields:{title:"The New Boss",date:"05 Feb 2000",slug:"/2000-02-05-the-new-boss/"}}},{node:{fields:{title:"Thursday",date:"03 Feb 2000",slug:"/2000-02-03-thursday/",tags:"Y2000"},html:"<p>Our stock closed at 40. Today we issued a press release about an upcoming WAP product.</p>"},next:{fields:{title:"Wednesday",date:"02 Feb 2000",slug:"/2000-02-02-wednesday/"}},previous:{fields:{title:"Casual Friday",date:"04 Feb 2000",slug:"/2000-02-04-casual-friday/"}}}],pathPrefix:"",first:!1,last:!1,index:1083,pageCount:1101}}}});
